import React from "react";
import { Header, Image } from "semantic-ui-react";
// import "./userStrip.css";

const urls = [
  "data:image/png;base64,",
  "data:image/png;base64,",
  "data:image/png;base64,",
  "data:image/png;base64,",
  "data:image/jpeg;base64,",
  "data:image/png;base64,",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "data:image/png;base64,",
  "data:image/jpeg;base64,",
  "data:image/png;base64,",
  "data:image/jpeg;base64,"
];

class HeaderExampleImage extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      image: ""
    };
  }

  componentWillMount() {
    const image = urls[Math.floor(Math.random() * urls.length)];
    this.setState({ image: image });
  }

  render() {
    return (
      // <Header as="h2" className="FansBox">
      //   <Image className="avatar" circular src={this.state.image} /> {this.props.userName}
      // </Header>
      <li class="active">
        <div class="d-flex bd-highlight">
          <div class="img_cont">
            <img src={this.state.image} class="rounded-circle user_img" />
            <span class="online_icon" />
          </div>
          <div class="user_info">
            <span>{this.props.userName}</span>
          </div>
        </div>
      </li>
    );
  }
}

export default HeaderExampleImage;
